import React, {Component} from 'react';
import Navigation from './Navigation';
import Heading from './Heading';
import Submit from './Submit';

import Bottom from './Bottom';


class App  extends Component {
    render(){
        return(
            <div>
                <Navigation/>
                <Heading/>
                <Submit/>
                <Bottom/>
            </div>
        )
    }
}



export default App;
